import React from "react";
import "./passwordGenerated.css"
import {useState, useEffect} from "react";

export function PasswordGenerated(props) {
    const {value, numbers, signs} = props;
    console.log(value);

    let [password, setPassword] = useState();
    function CreatePassword (value, numbers, signs ) {
        console.log(value);
        let counter = Number(value);
        let password = '';
        let charSet = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ"
        if (numbers) charSet+="0123456789";
        if (signs) charSet+='!@#$%^&*()_+~`|}{[]:;?><,./-=';
        console.log(charSet);
        console.log(counter);
        while(password.length < counter){
            password = password + charSet.charAt(Math.ceil((charSet.length * Math.random() * Math.random() * 10)))
            console.log(password);
        }

        setPassword(password);
    }

    useEffect(() => CreatePassword(numbers, value, signs), [numbers, value, signs]);
    // useEffect(() => CreatePassword(numbers, value, signs), []);

    return (
        <div>
            <div className='passwordDiv '>
                <p className=' password'>
                    {password}
                </p>
            </div>
            {props.children}
        </div>
    )

}
